// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "../node_modules/@openzeppelin/contracts/access/AccessControl.sol";
import "../node_modules/@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "./PurpleButterflyToken.sol";

/// @custom:security-contact laviniascmelo@gmail.com
contract PurpleButterfly is ERC721, ERC721Burnable, AccessControl {
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant BURNER_ROLE = keccak256("BURNER_ROLE");
    using ECDSA for bytes32;

    PurpleButterflyToken private _pbftk;

    constructor() ERC721("PurpleButterfly", "PBFLY") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(MINTER_ROLE, msg.sender);
        _grantRole(BURNER_ROLE, msg.sender);
    }

    function getTokenAddress() public view returns (address) {
        return address(_pbftk);
    }

    function setTokenAddress(
        address tokenAddress
    ) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _pbftk = PurpleButterflyToken(tokenAddress);
    }

    mapping(uint256 => Post) private posts;
    mapping(uint256 => Comment) private comments;

    struct Post {
        string content;
        address author;
    }

    struct Comment {
        string content;
        address author;
        uint256 postId;
    }

    event PostMinted(uint256 tokenId, address owner, string content);
    event ContentLiked(uint256 indexed tokenId, address indexed liker);

    function mintPost(
        string memory content,
        bytes memory signature,
        uint256 tokenId
    ) public payable {

        require(!_exists(tokenId), "Token already minted");
        require(
            _pbftk.balanceOf(_msgSender()) >= 1 ether,
            "Not enough tokens to MINT"
        );
        verifySignature(tokenId, signature);


        _mint(msg.sender, tokenId);
        _pbftk.transfer(msg.sender, 1 ether);

        posts[tokenId] = Post(content, _msgSender());
    }

    function verifySignature(
        uint256 tokenId,
        bytes memory signature
    ) public view returns (bool) {


        require(!_exists(tokenId), "Token ID already exists");

        address owner = address(this);

        bytes32 messageHash = keccak256(abi.encodePacked(tokenId));
        address signer = messageHash.toEthSignedMessageHash().recover(
            signature
        );

        return signer == owner;
    }

    function likeContent(uint256 tokenId) public {
        require(_exists(tokenId), "Invalid token");
        require(_msgSender() != ownerOf(tokenId), "Can't like own content");
        require(
            _pbftk.balanceOf(_msgSender()) > 0,
            "Not enough tokens to give a like"
        );

        address contentOwner = ownerOf(tokenId);
        _pbftk.transfer(contentOwner, 1 ether);

        emit ContentLiked(tokenId, _msgSender());
    }

    // The following functions are overrides required by Solidity.
    function supportsInterface(
        bytes4 interfaceId
    ) public view override(ERC721, AccessControl) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}
